class Node {
// Node for doubly linked list
public:
    int key;
    int value;
    Node* prev;
    Node* next;

    Node(int key, int value) {
        this->key = key;
        this->value = value;
        this->prev = nullptr;
        this->next = nullptr;
    }
};

void update_node_to_head(Node *head, Node *curr_node) {
    // remove the node from the order
    curr_node->prev->next = curr_node->next;
    curr_node->next->prev = curr_node->prev;

    // insert at the head (remember we also have dummy head)
    curr_node->next = head->next;
    head->next->prev = curr_node;
    curr_node->prev = head;
    head->next = curr_node;
}

class LRUCache {
public:
	LRUCache(int capacity) {
        unordered_map<int, Node*> cache;
        
        // create dummy nodes
        Node *head = new Node(INT_MAX, INT_MAX);
        Node *tail = new Node(INT_MAX, INT_MAX);
        
        // connect dummy nodes together
        head->next = tail;
        tail->prev = head;
	}

	int get(int key) {
		// 1. check if the key exists
        if(cache.count(key) == 0) {
            // this key doesn't exist
            return -1;
        }
        // insert the node at the head of the linked list
        Node* curr_node = cache[key];
        update_node_to_head(head, curr_node);
        return curr_node->value;
	}

	void put(int key, int value) {
        if(cache.count(key) > 0) {
            // just update the data

            return;
        }
        // we need to insert
		if(cache.size() > capacity) {
            // we will have to remove the LRU data
            // to remove the LRU data, remove from tail
            delete_from_tail(tail); // should remove the tail->prev node
        }
        // insert the data here
	}
}

