class Solution {
public:
    bool util(int i, int k) {
        if(i == 1) return false;
        if(k < (1<<(i-1))) return util(i-1, k);
        if( k == (1<<(i-1)) ) return true;
        return !util(i-1, (1<<i) - k);
    }
    char findKthBit(int i, int k) {
        return util(i, k) ? '1' : '0';
    }
};

