class Solution {
public:
	SinglyLinkedListNode*  deleteDuplicates(SinglyLinkedListNode* & head) {
        SinglyLinkedListNode *curr_node = head, *next_node;
        SinglyLinkedListNode *tail = NULL;
        head = NULL;
        while(curr_node!=NULL) {
            bool is_duplicate = false;
            while(curr_node->next!=NULL and curr_node->next->data == curr_node->data) {
                // skip through the duplicates
                curr_node = curr_node->next;
                is_duplicate = true;
            }
            next_node = curr_node->next;
            if(!is_duplicate) {
                if(head==NULL) {
                    head = curr_node;
                    tail = curr_node;
                    tail->next = NULL;
                }
                else {
                    tail->next = curr_node;
                    tail = curr_node;
                    tail->next = NULL;
                }
            }
            curr_node = next_node;
        }
        return head;
	}
};

